-- ----------------------------
--  Table structure for `t_device`
-- ----------------------------
DROP TABLE IF EXISTS `t_device`;
CREATE TABLE `t_device` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `sn` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '设备id编号',
  `name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '设备昵称',
  `typeId` int(100) DEFAULT NULL COMMENT '类型',
  `location` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '设备的位置',
  `image` varchar(2000) COLLATE utf8mb4_bin DEFAULT '' COMMENT '设备图片',
  `installTime` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '安装时间',
  `state` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '状态：0 在线    1 离线',
  `standard` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '规格',
  `manufacturer` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '生产厂家',
  `userId` int(11) DEFAULT NULL COMMENT '拥有者',
  `softwareVersion` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '设备软件版本号',
  `thresholdMin` float(11,0) DEFAULT NULL COMMENT '设备阈值的最小值',
  `thresholdMax` float(11,0) DEFAULT NULL COMMENT '设备阈值的最大值',
  `remark` varchar(500) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '设备备注',
  `createTime` datetime DEFAULT NULL,
  `updateTime` datetime DEFAULT NULL,
  `operator` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '操作人员',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

