-- ----------------------------
--  Table structure for `t_device_gather`
-- ----------------------------
DROP TABLE IF EXISTS `t_device_gather`;
CREATE TABLE `t_device_gather` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '设备采集数据主键',
  `deviceId` int(11) DEFAULT NULL COMMENT '采集的设备id',
  `deviceName` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '设备名称',
  `basicData` float DEFAULT NULL COMMENT '采集的数据',
  `measurementUnitId` int(11) DEFAULT NULL COMMENT '计量单位id,不同的传感器有不同的单位',
  `measurementUnit` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '计量单位',
  `gatherTime` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '采集时间',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `updateTime` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

