INSERT INTO `t_notice` VALUES ('1', '关于系统开放测试的公告', '<p><font face=\"仿宋_GB2312\">&nbsp; &nbsp; 为创造我市食品安全良好宣传氛围，厦门市</font><span>2018年食品质量安全宣传周已于7月17日启动。作为宣传周系列活动内容之一，现定于7月20日作为农产品检测实验室开放日，由主要承担我市食用农产品检测任务的厦门市农产品质量安全检验测试中心面向广大市民开放相关实验室，活动内容为参观实验室检测设备、检测流程及现场咨询讲解，欢迎社会各界市民踊跃报名参加。</span></p><p><span>&nbsp; &nbsp; &nbsp;&nbsp;</span><font face=\"仿宋_GB2312\">为创造我市食品安全良好宣传氛围，厦门市</font><span>2018年食品质量安全宣传周已于7月17日启动。作为宣传周系列活动内容之一，现定于7月20日作为农产品检测实验室开放日，由主要承担我市食用农产品检测任务的厦门市农产品质量安全检验测试中心面向广大市民开放相关实验室，活动内容为参观实验室检测设备、检测流程及现场咨询讲解，欢迎社会各界市民踊跃报名参加。</span></p><p><span>&nbsp; &nbsp;&nbsp;</span><font face=\"仿宋_GB2312\">为创造我市食品安全良好宣传氛围，厦门市</font><span>2018年食品质量安全宣传周已于7月17日启动。作为宣传周系列活动内容之一，现定于7月20日作为农产品检测实验室开放日，由主要承担我市食用农产品检测任务的厦门市农产品质量安全检验测试中心面向广大市民开放相关实验室，活动内容为参观实验室检测设备、检测流程及现场咨询讲解，欢迎社会各界市民踊跃报名参加。</span></p>  \n					', '1', '2018-12-15 10:44:08', '2018-12-15 10:44:08'), ('2', '关于开展全市“智慧农业”统计监测工作的通知', '<p class=\"MsoNormal\" _fckxhtmljob=\"2\" accidx=\"100\"><span _fckxhtmljob=\"2\" accidx=\"102\" leaidx=\"38\" class=\"leaidx\" tabindex=\"0\">各市、区农委（农业局、经济发展委员会、城乡发展局）：</span></p><p class=\"MsoNormal\" _fckxhtmljob=\"2\" accidx=\"103\"><span _fckxhtmljob=\"2\" accidx=\"105\" leaidx=\"39\" class=\"leaidx\" tabindex=\"0\">为全面掌握我市“智慧农业”发展基本情况，深入了解农业物联网技术应用和农产品电子商务工作进展，总结全市“智慧农业”发展经验，提前谋划</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"107\" leaidx=\"40\" class=\"leaidx\" tabindex=\"0\">2018</span><span _fckxhtmljob=\"2\" accidx=\"109\" leaidx=\"41\" class=\"leaidx\" tabindex=\"0\">年工作思路，加快推进全市“互联网</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"111\">+</span><span _fckxhtmljob=\"2\" accidx=\"113\" leaidx=\"42\" class=\"leaidx\" tabindex=\"0\">”现代农业发展，经研究，决定开展全市“智慧农业”统计监测工作，现将有关事项通知如下：</span></p><p class=\"MsoNormal\" _fckxhtmljob=\"2\" accidx=\"114\"><span _fckxhtmljob=\"2\" accidx=\"116\" leaidx=\"43\" class=\"leaidx\" tabindex=\"0\">一、工作要求</span></p><p class=\"MsoNormal\" _fckxhtmljob=\"2\" accidx=\"117\"><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"119\" leaidx=\"44\" class=\"leaidx\" tabindex=\"0\">1</span><span _fckxhtmljob=\"2\" accidx=\"121\" leaidx=\"45\" class=\"leaidx\" tabindex=\"0\">．各地务必要重视本次统计监测工作，落实专人负责，确保统计监测全覆盖，相关数据填报截止日期为</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"123\" leaidx=\"46\" class=\"leaidx\" tabindex=\"0\">2017</span><span _fckxhtmljob=\"2\" accidx=\"125\" leaidx=\"47\" class=\"leaidx\" tabindex=\"0\">年</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"127\" leaidx=\"48\" class=\"leaidx\" tabindex=\"0\">12</span><span _fckxhtmljob=\"2\" accidx=\"129\" leaidx=\"49\" class=\"leaidx\" tabindex=\"0\">月</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"131\" leaidx=\"50\" class=\"leaidx\" tabindex=\"0\">31</span><span _fckxhtmljob=\"2\" accidx=\"133\" leaidx=\"51\" class=\"leaidx\" tabindex=\"0\">日。</span></p><p class=\"MsoNormal\" _fckxhtmljob=\"2\" accidx=\"134\"><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"136\" leaidx=\"52\" class=\"leaidx\" tabindex=\"0\">2</span><span _fckxhtmljob=\"2\" accidx=\"138\">．</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"140\" leaidx=\"53\" class=\"leaidx\" tabindex=\"0\">2018</span><span _fckxhtmljob=\"2\" accidx=\"142\" leaidx=\"54\" class=\"leaidx\" tabindex=\"0\">年，我委将要组织编印《全市“互联网</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"144\">+</span><span _fckxhtmljob=\"2\" accidx=\"146\" leaidx=\"55\" class=\"leaidx\" tabindex=\"0\">”现代农业典型案例集锦》，各地要择优推荐</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"148\" leaidx=\"56\" class=\"leaidx\" tabindex=\"0\">5</span><span _fckxhtmljob=\"2\" accidx=\"150\" leaidx=\"57\" class=\"leaidx\" tabindex=\"0\">个农业物联网技术应用和</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"152\" leaidx=\"58\" class=\"leaidx\" tabindex=\"0\">5</span><span _fckxhtmljob=\"2\" accidx=\"154\" leaidx=\"59\" class=\"leaidx\" tabindex=\"0\">个农产品电子商务典型案例，并报送详细介绍材料（其中农业物联网技术应用分大田种植、水产养殖、设施园艺、畜禽养殖栏目报送，不超过</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"156\" leaidx=\"60\" class=\"leaidx\" tabindex=\"0\">800</span><span _fckxhtmljob=\"2\" accidx=\"158\" leaidx=\"61\" class=\"leaidx\" tabindex=\"0\">个字），每个典型案例至少提供</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"160\" leaidx=\"62\" class=\"leaidx\" tabindex=\"0\">5</span><span _fckxhtmljob=\"2\" accidx=\"162\" leaidx=\"63\" class=\"leaidx\" tabindex=\"0\">张清晰图片（标明时间、地点、类别等）。</span></p><p class=\"MsoNormal\" _fckxhtmljob=\"2\" accidx=\"163\"><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"165\" leaidx=\"64\" class=\"leaidx\" tabindex=\"0\">3</span><span _fckxhtmljob=\"2\" accidx=\"167\" leaidx=\"65\" class=\"leaidx\" tabindex=\"0\">．各地要仔细梳理</span><span _fckxhtmljob=\"2\" accidx=\"169\" leaidx=\"66\" class=\"leaidx\" tabindex=\"0\">已制定的扶持</span><span _fckxhtmljob=\"2\" accidx=\"171\" leaidx=\"67\" class=\"leaidx\" tabindex=\"0\">“智慧农业”发展</span><span _fckxhtmljob=\"2\" accidx=\"173\" leaidx=\"68\" class=\"leaidx\" tabindex=\"0\">相关奖补政策和措施，以附件材料报送。</span></p><p class=\"MsoNormal\" _fckxhtmljob=\"2\" accidx=\"174\"><span _fckxhtmljob=\"2\" accidx=\"176\" leaidx=\"69\" class=\"leaidx\" tabindex=\"0\">二、报送要求</span></p><p class=\"MsoNormal\" _fckxhtmljob=\"2\" accidx=\"177\"><span _fckxhtmljob=\"2\" accidx=\"179\" leaidx=\"70\" class=\"leaidx\" tabindex=\"0\">请各市（区）认真做好</span><span _fckxhtmljob=\"2\" accidx=\"181\" leaidx=\"71\" class=\"leaidx\" tabindex=\"0\">“智慧农业”统计监</span><span _fckxhtmljob=\"2\" accidx=\"183\" leaidx=\"72\" class=\"leaidx\" tabindex=\"0\">测的部署、调查、汇总和材料初审等工作，</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"185\" leaidx=\"73\" class=\"leaidx\" tabindex=\"0\">2018</span><span _fckxhtmljob=\"2\" accidx=\"187\" leaidx=\"74\" class=\"leaidx\" tabindex=\"0\">年</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"189\" leaidx=\"75\" class=\"leaidx\" tabindex=\"0\">1</span><span _fckxhtmljob=\"2\" accidx=\"191\" leaidx=\"76\" class=\"leaidx\" tabindex=\"0\">月</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"193\" leaidx=\"77\" class=\"leaidx\" tabindex=\"0\">15</span><span _fckxhtmljob=\"2\" accidx=\"195\" leaidx=\"78\" class=\"leaidx\" tabindex=\"0\">日（星期一）下班前上报电子稿并寄出纸质版（经分管领导同意后盖章上报）。联系人：李跃文，电话：</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"197\" leaidx=\"79\" class=\"leaidx\" tabindex=\"0\">65254998</span><span _fckxhtmljob=\"2\" accidx=\"199\" leaidx=\"80\" class=\"leaidx\" tabindex=\"0\">，邮箱：</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"201\" leaidx=\"81\" class=\"leaidx\" tabindex=\"0\">664052214@qq.com</span><span _fckxhtmljob=\"2\" accidx=\"203\" leaidx=\"82\" class=\"leaidx\" tabindex=\"0\">，邮寄地址：苏州市东吴北路团结桥巷</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"205\" leaidx=\"83\" class=\"leaidx\" tabindex=\"0\">2</span><span _fckxhtmljob=\"2\" accidx=\"207\" leaidx=\"84\" class=\"leaidx\" tabindex=\"0\">号。</span></p><p class=\"MsoNormal\" align=\"center\" _fckxhtmljob=\"2\" accidx=\"208\" style=\"text-align: center;\"><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"209\">&nbsp;</span></p><p class=\"MsoNormal\" align=\"left\" _fckxhtmljob=\"2\" accidx=\"210\"><span _fckxhtmljob=\"2\" accidx=\"212\" leaidx=\"85\" class=\"leaidx\" tabindex=\"0\">附件：</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"214\" leaidx=\"86\" class=\"leaidx\" tabindex=\"0\">1</span><span _fckxhtmljob=\"2\" accidx=\"216\" leaidx=\"87\" class=\"leaidx\" tabindex=\"0\">．全市农业物联网技术应用情况统计监测表</span></p><p class=\"MsoNormal\" align=\"left\" _fckxhtmljob=\"2\" accidx=\"217\"><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"219\" leaidx=\"88\" class=\"leaidx\" tabindex=\"0\">2</span><span _fckxhtmljob=\"2\" accidx=\"221\" leaidx=\"89\" class=\"leaidx\" tabindex=\"0\">．全市农产品电子商务发展情况统计监测表</span></p><p class=\"MsoNormal\" _fckxhtmljob=\"2\" accidx=\"222\"><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"224\" leaidx=\"90\" class=\"leaidx\" tabindex=\"0\">3</span><span _fckxhtmljob=\"2\" accidx=\"226\" leaidx=\"91\" class=\"leaidx\" tabindex=\"0\">．全市“互联网</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"228\">+</span><span _fckxhtmljob=\"2\" accidx=\"230\" leaidx=\"92\" class=\"leaidx\" tabindex=\"0\">”现代农业典型案例集锦初步格式</span></p><p class=\"MsoNormal\" align=\"right\" _fckxhtmljob=\"2\" accidx=\"231\" style=\"text-align: right;\"><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"232\">&nbsp;</span></p><p class=\"MsoNormal\" align=\"right\" _fckxhtmljob=\"2\" accidx=\"233\" style=\"text-align: right;\"><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"234\">&nbsp;</span></p><p class=\"MsoNormal\" align=\"right\" _fckxhtmljob=\"2\" accidx=\"235\" style=\"text-align: right;\"><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"236\">&nbsp;</span></p><p class=\"MsoNormal\" align=\"right\" _fckxhtmljob=\"2\" accidx=\"237\" style=\"text-align: right;\"><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"238\">&nbsp;</span></p><p class=\"MsoNormal\" align=\"right\" _fckxhtmljob=\"2\" accidx=\"239\" style=\"text-align: right;\"><span _fckxhtmljob=\"2\" accidx=\"241\" leaidx=\"93\" class=\"leaidx\" tabindex=\"0\">苏州市农业委员会</span></p><p class=\"MsoNormal\" align=\"right\" _fckxhtmljob=\"2\" accidx=\"242\" style=\"text-align: right;\"><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"243\"><span _fckxhtmljob=\"2\" accidx=\"244\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span _fckxhtmljob=\"2\" accidx=\"245\">&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"246\"><span _fckxhtmljob=\"2\" accidx=\"247\">&nbsp;&nbsp;</span><text class=\"acctext leaidx\" accidx=\"248\" leaidx=\"94\" tabindex=\"0\" style=\"text-align: inherit;\">2017</text></span><span _fckxhtmljob=\"2\" accidx=\"250\" leaidx=\"95\" class=\"leaidx\" tabindex=\"0\">年</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"252\" leaidx=\"96\" class=\"leaidx\" tabindex=\"0\">12</span><span _fckxhtmljob=\"2\" accidx=\"254\" leaidx=\"97\" class=\"leaidx\" tabindex=\"0\">月</span><span lang=\"EN-US\" _fckxhtmljob=\"2\" accidx=\"256\" leaidx=\"98\" class=\"leaidx\" tabindex=\"0\">12</span><span _fckxhtmljob=\"2\" accidx=\"258\" leaidx=\"99\" class=\"leaidx\" tabindex=\"0\">日</span></p><p class=\"MsoNormal\" _fckxhtmljob=\"2\" accidx=\"259\"><span _fckxhtmljob=\"2\" accidx=\"261\" leaidx=\"100\" class=\"leaidx\" tabindex=\"0\">（此件主动公开）</span></p>  \n					', '1', '2018-12-23 16:41:29', '2018-12-23 16:41:29'), ('4', '智慧农业：物联网智慧养牛系统', '<p style=\"text-align: justify;\"><span class=\"bjh-p\">智慧养牛系统解决方案通过运用最新的物联网技术和RFID技术将智慧养牛生产管理、智慧养牛系统环境监控、智慧专家系统、一品一码产品溯源整合为一套完整的系统。让养殖户轻松打理养牛系统，理顺生产流程，生产安全牛肉。</span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\">一、智慧养牛生产管理系统</span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\">　　智慧养牛系统中的生产管理系统groupyf通过汇集生产流程中的重要信息,如饲料信息、生产计划、疫苗信息等，通过物联网智能采集器把数据实时的传输到物联网平台上，从而可以远程通过智能手机或电脑进行数据查看和智能分析。提升养牛场的整体管理水平，为养殖户节省管理成本。</span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\">二、智慧养牛系统环境监控智能化</span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\">　　1、智慧养牛系统环境监控：养牛场环境与牛的成长息息相关，环境质量变差会导致牛的发育不良甚至爆发疫病。智慧养牛系统将牛场的温度、湿度、空气质量等环境变量统一监控并通过物联网采集器实时传输在客户端（APP、PC、演示大屏）中集中呈现，让养牛场的环境情况透明化。</span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\">　　2、预警、设备控制智能化：对于监控中的环境变量，当其达到预设危险值时通过现场声光、电话、微信等通讯告警方式告知养殖户。并对警报信息进行处理，可通过预设设备自动控制来减少日常工作量。如风机的启动、水帘的控制，喂料器的启动，实现智慧养牛。</span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\">三、智慧专家系统</span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\">1、养殖户在养殖牛过程中遇到问题时，智慧专家系统会根据实际情况给出最佳的解决方案。</span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\"></span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\">2、智慧养牛监控系统在遇到紧急情况时会发出警告通知用户并同时推荐给养殖户最佳的处理方案。</span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\">四、智慧农业一品一码产品溯源系统</span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\"></span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\">　　智慧农业一品一码产品溯源系统中农智慧农业科技综合运用了先进的物联网、移动互联网、二维码、RFID等物联网技术手段，研发的农产品安全追溯生产管理系统。为消费者打通一条深入了解农产品生产信息可信通路，解决供需双方信息不对称、不透明问题，为农产品安全保驾护航。实现了对农业生产、流通等环节信息的溯源管理。智慧农业一品一码产品溯源系统分为生产溯源和销售溯源两大部分，通过先进物联网技术实现牛生产、运输、销售全过程的溯源追踪，为优化牛养殖流程、打造放心牛肉提供数据支撑。</span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\">　　生产溯源：一品一码生产溯源技术主要应用于养牛系统中的生产管理优化。智慧养牛系统通过记录每头牛成长中的喂养细节，汇聚成为一个牛数据库，为养殖户描绘牛养殖最佳的轨迹线。</span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\"></span></p><p style=\"text-align: justify;\"><span class=\"bjh-p\">　　销售溯源：应用于牛肉运输、销售过程监督。从牛出栏、屠宰场分割、运输配送、超市售卖，每一个环节的信息都记录在案。牛肉的溯源对于养殖户可以提高产品的质量，打造高质量牛品牌。对于消费者来说通过手机二维码程序（通用）直接扫描，手机会显示该牛肉的详细追溯信息，包括生长环境数据、肉质健康情况等。</span></p>  \n					', '1', '2018-12-23 16:44:37', '2018-12-23 16:44:43');
COMMIT;

